(1865, 1, '2014-09-27 03:43:49', '2014-09-27 03:43:49', '<p>Theo AFP, Lầu Năm Góc cho biết ngày 26/8, một tàu tuần duyên Mỹ đã có cuộc chạm trán căng thẳng với một tàu đánh cá Iran trên vùng Vịnh và đã phải bắn cảnh cáo.</p>\n<p><a href="http://mytien-nacha.com/dev/wp-content/uploads/2014/08/US_coast_guard.jpg"><img class="size-medium wp-image-1721 aligncenter" src="http://mytien-nacha.com/dev/wp-content/uploads/2014/08/US_coast_guard-300x176.jpg" alt="US_coast_guard" width="300" height="176" /></a></p>\n<p><strong><span style="color: #ff0000;">Các sĩ quan quân sự Mỹ cho biết tàu Monomoy của Lực lượng Tuần duyên Mỹ đã cử một xuồng nhỏ tiếp cận tàu cá của Iran và khi đến gần, những người Mỹ đã phát hiện 2 súng máy nòng 50 mm, trong đó có 1 súng đang chĩa về phía họ.</span></strong></p>\n<p>&nbsp;</p>\n<p>Theo phát ngôn viên Hạm đội 5 của Mỹ - Đại úy Joseph Hontz, những người Mỹ đã rút lui và bắn 1 phát súng cảnh cáo.</p>\n<p>Người phát ngôn Lầu Năm Góc John Kirby nói rằng tàu cá Iran sau đó cũng rút lui và không ai bị thương. Theo Thiếu tướng Kirby, tàu tuần duyên của Mỹ khi đó đang thực hiện "hoạt động an ninh trên biển thông thường"./.</p>\n', 'Tàu tuần duyên Mỹ "bắn cảnh cáo" khi chạm trán tàu cá Iran', '', 'inherit', 'open', 'open', '', '1720-autosave-v1', '', '', '2014-09-27 03:43:49', '2014-09-27 03:43:49', '', 1720, 'http://mytien-nacha.com/dev/1720-autosave-v1/', 0, 'revision', '', 0),
