(1713, 1, '2014-08-26 09:31:43', '2014-08-26 09:31:43', '<h2>Headings</h2>\r\n<h1>Header one</h1>\r\n<h2>Header two</h2>\r\n<h3>Header three</h3>\r\n<h4>Header four</h4>\r\n<h5>Header five</h5>\r\n<h6>Header six</h6>\r\n<h2>Blockquotes</h2>\r\nSingle line blockquote:\r\n<blockquote>Stay hungry. Stay foolish.</blockquote>\r\nMulti line blockquote with a cite reference:\r\n<blockquote>People think focus means saying yes to the thing you''ve got to focus on. But that''s not what it means at all. It means saying no to the hundred other good ideas that there are. You have to pick carefully. I''m actually as proud of the things we haven''t done as the things I have done. Innovation is saying no to 1,000 things. <cite>Steve Jobs - Apple Worldwide Developers'' Conference, 1997</cite></blockquote>\r\n<h2>Tables</h2>\r\n<table>\r\n<thead>\r\n<tr>\r\n<th>Employee</th>\r\n<th>Salary</th>\r\n<th></th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<th><a href="http://example.org/">John Doe</a></th>\r\n<td>$1</td>\r\n<td>Because that''s all Steve Jobs needed for a salary.</td>\r\n</tr>\r\n<tr>\r\n<th><a href="http://example.org/">Jane Doe</a></th>\r\n<td>$100K</td>\r\n<td>For all the blogging she does.</td>\r\n</tr>\r\n<tr>\r\n<th><a href="http://example.org/">Fred Bloggs</a></th>\r\n<td>$100M</td>\r\n<td>Pictures are worth a thousand words, right? So Jane x 1,000.</td>\r\n</tr>\r\n<tr>\r\n<th><a href="http://example.org/">Jane Bloggs</a></th>\r\n<td>$100B</td>\r\n<td>With hair like that?! Enough said...</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>Definition Lists</h2>\r\n<dl><dt>Definition List Title</dt><dd>Definition list division.</dd><dt>Startup</dt><dd>A startup company or startup is a company or temporary organization designed to search for a repeatable and scalable business model.</dd><dt>#dowork</dt><dd>Coined by Rob Dyrdek and his personal body guard Christopher "Big Black" Boykins, "Do Work" works as a self motivator, to motivating your friends.</dd><dt>Do It Live</dt><dd>I''ll let Bill O''Reilly will <a title="We''ll Do It Live" href="https://www.youtube.com/watch?v=O_HyZ5aW76c">explain</a> this one.</dd></dl>\r\n<h2>Unordered Lists (Nested)</h2>\r\n<ul>\r\n	<li>List item one\r\n<ul>\r\n	<li>List item one\r\n<ul>\r\n	<li>List item one</li>\r\n	<li>List item two</li>\r\n	<li>List item three</li>\r\n	<li>List item four</li>\r\n</ul>\r\n</li>\r\n	<li>List item two</li>\r\n	<li>List item three</li>\r\n	<li>List item four</li>\r\n</ul>\r\n</li>\r\n	<li>List item two</li>\r\n	<li>List item three</li>\r\n	<li>List item four</li>\r\n</ul>\r\n<h2>Ordered List (Nested)</h2>\r\n<ol>\r\n	<li>List item one\r\n<ol>\r\n	<li>List item one\r\n<ol>\r\n	<li>List item one</li>\r\n	<li>List item two</li>\r\n	<li>List item three</li>\r\n	<li>List item four</li>\r\n</ol>\r\n</li>\r\n	<li>List item two</li>\r\n	<li>List item three</li>\r\n	<li>List item four</li>\r\n</ol>\r\n</li>\r\n	<li>List item two</li>\r\n	<li>List item three</li>\r\n	<li>List item four</li>\r\n</ol>\r\n<h2>HTML Tags</h2>\r\nThese supported tags come from the WordPress.com code <a title="Code" href="http://en.support.wordpress.com/code/">FAQ</a>.\r\n\r\n<strong>Address Tag</strong>\r\n\r\n<address>1 Infinite Loop\r\nCupertino, CA 95014\r\nUnited States</address><strong>Anchor Tag (aka. Link)</strong>\r\n\r\nThis is an example of a <a title="Apple" href="http://apple.com">link</a>.\r\n\r\n<strong>Abbreviation Tag</strong>\r\n\r\nThe abbreviation <abbr title="Seriously">srsly</abbr> stands for "seriously".\r\n\r\n<strong>Acronym Tag (<em>deprecated in HTML5</em>)</strong>\r\n\r\nThe acronym stands for "for the win".\r\n\r\n<strong>Big Tag <strong>(<em>deprecated in HTML5</em>)</strong></strong>\r\n\r\nThese tests are a big deal, but this tag is no longer supported in HTML5.\r\n\r\n<strong>Cite Tag</strong>\r\n\r\n"Code is poetry." --<cite>Automattic</cite>\r\n\r\n<strong>Code Tag</strong>\r\n\r\nYou will learn later on in these tests that <code>word-wrap: break-word;</code> will be your best friend.\r\n\r\n<strong>Delete Tag</strong>\r\n\r\nThis tag will let you <del>strikeout text</del>, but this tag is no longer supported in HTML5 (use the <code>&lt;strike&gt;</code> instead).\r\n\r\n<strong>Emphasize Tag</strong>\r\n\r\nThe emphasize tag should <em>italicize</em> text.\r\n\r\n<strong>Insert Tag</strong>\r\n\r\nThis tag should denote <ins>inserted</ins> text.\r\n\r\n<strong>Keyboard Tag</strong>\r\n\r\nThis scarcely known tag emulates <kbd>keyboard text</kbd>, which is usually styled like the <code>&lt;code&gt;</code> tag.\r\n\r\n<strong>Preformatted Tag</strong>\r\n\r\nThis tag styles large blocks of code.\r\n<pre>.post-title {\r\n	margin: 0 0 5px;\r\n	font-weight: bold;\r\n	font-size: 38px;\r\n	line-height: 1.2;\r\n	and here''s a line of some really, really, really, really long text, just to see how the PRE tag handles it and to find out how it overflows;\r\n}</pre>\r\n<strong>Quote Tag</strong>\r\n\r\n<q>Developers, developers, developers...</q> --Steve Ballmer\r\n\r\n<strong>Strike Tag <strong>(<em>deprecated in HTML5</em>)</strong></strong>\r\n\r\nThis tag shows <span style="text-decoration: line-through;">strike-through text</span>\r\n\r\n<strong>Strong Tag</strong>\r\n\r\nThis tag shows <strong>bold<strong> text.</strong></strong>\r\n\r\n<strong>Subscript Tag</strong>\r\n\r\nGetting our science styling on with H<sub>2</sub>O, which should push the "2" down.\r\n\r\n<strong>Superscript Tag</strong>\r\n\r\nStill sticking with science and Isaac Newton''s E = MC<sup>2</sup>, which should lift the 2 up.\r\n\r\n<strong>Teletype Tag <strong>(<em>deprecated in HTML5</em>)</strong></strong>\r\n\r\nThis rarely used tag emulates teletype text, which is usually styled like the <code>&lt;code&gt;</code> tag.\r\n\r\n<strong>Variable Tag</strong>\r\n\r\nThis allows you to denote <var>variables</var>.', 'Markup HTML Tags and Formatting2', '', 'publish', 'open', 'open', '', 'markup-html-tags-formatting2', '', '', '2014-10-03 02:50:36', '2014-10-03 02:50:36', '', 0, 'http://mytien-nacha.com/dev/?post_type=tin-tuc&#038;p=1713', 0, 'tin-tuc', '', 0),
(1715, 1, '2014-08-26 09:36:35', '2014-08-26 09:36:35', '<strong>UBND Bình Phước đã tạm đình chỉ công tác của 2 ông Phạm Thành Chung, Phó Giám đốc Sở Nội vụ và ông Bùi Quốc Khánh - Phó giám đốc Sở Ngoại vụ trong thời gian 1 tháng để xác minh làm rõ sự việc. </strong>\r\n\r\nSáng 25/8, nguồn tin của VietNamNet xác nhận, UBND tỉnh Bình Phước vừa có cuộc họp xử lý vụ 2 Phó giám đốc sở Nội vụ và Ngoại vụ đánh nhau tại quán nhậu vào ngày 12/8, gây xôn xao dư luận thời gian qua.\r\n\r\nTrước mắt, UBND tỉnh Bình Phước đã tạm đình chỉ công tác của 2 ông Phạm Thành Chung - Phó Giám đốc Sở Nội vụ và ông Bùi Quốc Khánh - Phó giám đốc Sở Ngoại vụ trong thời gian 1 tháng để xác minh làm rõ sự việc.\r\n\r\nTại cuộc họp, theo ban cán sự Đảng UBND tỉnh Bình Phước, nội dung tường trình của 2 vị Phó giám đốc được cho là chưa phản ánh đúng bản chất sự việc.\r\n\r\nNgười bác tường trình này là Bí thư tỉnh ủy Bình Phước - ông Nguyễn Tấn Hưng.\r\n\r\nTheo vị bí thư Tỉnh ủy, việc ''vô tình người này cụng ly trúng đầu người kia'', nhưng phải nhập viện khâu tới mấy mũi là việc khó tin, chứng tỏ bản tường trình chưa phản ánh đúng bản chất sự việc.\r\n\r\nÔng Nguyễn Tấn Hưng yêu cầu chuyển vụ việc về Đảng bộ cơ sở là Sở Nội vụ và Ngoại vụ tiến hành xác minh làm rõ sự việc, kiến nghị hình thức xử lý kỷ luật để Ủy ban Kiểm tra Tỉnh ủy xem xét, xử lý... trên tinh thần xử lý nghiêm, không bao che, góp phần làm trong sạch đội ngũ cán bộ công chức, Đảng viên.\r\n\r\nTrước đó, 2 vị Phó giám đốc này đã có giải trình, theo hướng phủ nhận việc xô xát, đánh nhau tại quán karaoke Bóng Trăng (đường Hùng Vương, thị xã Đồng Xoài) vào ngày 12/8 vừa qua.\r\n\r\nHai ông thừa nhận việc uống bia trong giờ làm việc là sai quy định, nhưng không hề có việc cãi vã và đánh nhau tới mức ông Khánh phang ly bia khiến đồng nghiệp bị thương tích ở đầu, rách tai phải đi cấp cứu như báo chí và dư luận phản ánh.\r\n\r\nNhư VietNamNet đã thông tin, khoảng 14 giờ ngày 12/8, sau khi kết thúc một lớp học dành cho chuyên viên chính, ông Phạm Thành Chung, Phó Giám đốc Sở Nội vụ và ông Bùi Quốc Khánh có tiếp khách tại nhà hàng karaoke Bóng Trăng (đường Hùng Vương, thị xã Đồng Xoài).\r\n\r\nTrong buổi nhậu, hai người có lời qua tiếng lại và xô xát. Hậu quả ông Chung phải đi bệnh viện may nhiều mũi ở vùng tai, đầu.\r\n\r\nVụ xô xát nhanh chóng lan truyền gây dư luận không tốt trong nhân dân và cán bộ tỉnh Bình Phước.\r\n\r\n<strong>Thanh Giang </strong>\r\n\r\n&nbsp;', 'Tạm đình chỉ 2 PGĐ sở đánh nhau trong quán nhậu', '', 'publish', 'open', 'open', '', 'tam-dinh-chi-2-pgd-danh-nhau-trong-quan-nhau', '', '', '2014-10-03 02:50:40', '2014-10-03 02:50:40', '', 0, 'http://mytien-nacha.com/dev/?post_type=tin-tuc&#038;p=1715', 0, 'tin-tuc', '', 0),
(1720, 1, '2014-08-27 01:22:41', '2014-08-27 01:22:41', 'Theo AFP, Lầu Năm Góc cho biết ngày 26/8, một tàu tuần duyên Mỹ đã có cuộc chạm trán căng thẳng với một tàu đánh cá Iran trên vùng Vịnh và đã phải bắn cảnh cáo.\r\n\r\n<a href="http://mytien-nacha.com/dev/wp-content/uploads/2014/08/US_coast_guard.jpg"><img class="size-medium wp-image-1721 aligncenter" src="http://mytien-nacha.com/dev/wp-content/uploads/2014/08/US_coast_guard-300x176.jpg" alt="US_coast_guard" width="300" height="176" /></a>\r\n\r\n<strong><span style="color: #ff0000;">Các sĩ quan quân sự Mỹ cho biết tàu Monomoy của Lực lượng Tuần duyên Mỹ đã cử một xuồng nhỏ tiếp cận tàu cá của Iran và khi đến gần, những người Mỹ đã phát hiện 2 súng máy nòng 50 mm, trong đó có 1 súng đang chĩa về phía họ.</span></strong>\r\n\r\n&nbsp;\r\n\r\nTheo phát ngôn viên Hạm đội 5 của Mỹ - Đại úy Joseph Hontz, những người Mỹ đã rút lui và bắn 1 phát súng cảnh cáo.\r\n\r\nNgười phát ngôn Lầu Năm Góc John Kirby nói rằng tàu cá Iran sau đó cũng rút lui và không ai bị thương. Theo Thiếu tướng Kirby, tàu tuần duyên của Mỹ khi đó đang thực hiện "hoạt động an ninh trên biển thông thường"./.', 'Tàu tuần duyên Mỹ "bắn cảnh cáo" khi chạm trán tàu cá Iran', '', 'publish', 'open', 'open', '', 'tau-tuan-duyen-ban-canh-cao-khi-cham-tran-tau-ca-iran', '', '', '2014-10-03 02:50:44', '2014-10-03 02:50:44', '', 0, 'http://mytien-nacha.com/dev/?post_type=tin-tuc&#038;p=1720', 2, 'tin-tuc', '', 0),
