(1872, 1, '2014-09-27 03:48:02', '2014-09-27 03:48:02', '<h2>Headings</h2>\r\n<h1>Header one</h1>\r\n<h2>Header two</h2>\r\n<h3>Header three</h3>\r\n<h4>Header four</h4>\r\n<h5>Header five</h5>\r\n<h6>Header six</h6>\r\n<h2>Blockquotes</h2>\r\nSingle line blockquote:\r\n<blockquote>Stay hungry. Stay foolish.</blockquote>\r\nMulti line blockquote with a cite reference:\r\n<blockquote>People think focus means saying yes to the thing you''ve got to focus on. But that''s not what it means at all. It means saying no to the hundred other good ideas that there are. You have to pick carefully. I''m actually as proud of the things we haven''t done as the things I have done. Innovation is saying no to 1,000 things. <cite>Steve Jobs - Apple Worldwide Developers'' Conference, 1997</cite></blockquote>\r\n<h2>Tables</h2>\r\n<table>\r\n<thead>\r\n<tr>\r\n<th>Employee</th>\r\n<th>Salary</th>\r\n<th></th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<th><a href="http://example.org/">John Doe</a></th>\r\n<td>$1</td>\r\n<td>Because that''s all Steve Jobs needed for a salary.</td>\r\n</tr>\r\n<tr>\r\n<th><a href="http://example.org/">Jane Doe</a></th>\r\n<td>$100K</td>\r\n<td>For all the blogging she does.</td>\r\n</tr>\r\n<tr>\r\n<th><a href="http://example.org/">Fred Bloggs</a></th>\r\n<td>$100M</td>\r\n<td>Pictures are worth a thousand words, right? So Jane x 1,000.</td>\r\n</tr>\r\n<tr>\r\n<th><a href="http://example.org/">Jane Bloggs</a></th>\r\n<td>$100B</td>\r\n<td>With hair like that?! Enough said...</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>Definition Lists</h2>\r\n<dl><dt>Definition List Title</dt><dd>Definition list division.</dd><dt>Startup</dt><dd>A startup company or startup is a company or temporary organization designed to search for a repeatable and scalable business model.</dd><dt>#dowork</dt><dd>Coined by Rob Dyrdek and his personal body guard Christopher "Big Black" Boykins, "Do Work" works as a self motivator, to motivating your friends.</dd><dt>Do It Live</dt><dd>I''ll let Bill O''Reilly will <a title="We''ll Do It Live" href="https://www.youtube.com/watch?v=O_HyZ5aW76c">explain</a> this one.</dd></dl>\r\n<h2>Unordered Lists (Nested)</h2>\r\n<ul>\r\n	<li>List item one\r\n<ul>\r\n	<li>List item one\r\n<ul>\r\n	<li>List item one</li>\r\n	<li>List item two</li>\r\n	<li>List item three</li>\r\n	<li>List item four</li>\r\n</ul>\r\n</li>\r\n	<li>List item two</li>\r\n	<li>List item three</li>\r\n	<li>List item four</li>\r\n</ul>\r\n</li>\r\n	<li>List item two</li>\r\n	<li>List item three</li>\r\n	<li>List item four</li>\r\n</ul>\r\n<h2>Ordered List (Nested)</h2>\r\n<ol>\r\n	<li>List item one\r\n<ol>\r\n	<li>List item one\r\n<ol>\r\n	<li>List item one</li>\r\n	<li>List item two</li>\r\n	<li>List item three</li>\r\n	<li>List item four</li>\r\n</ol>\r\n</li>\r\n	<li>List item two</li>\r\n	<li>List item three</li>\r\n	<li>List item four</li>\r\n</ol>\r\n</li>\r\n	<li>List item two</li>\r\n	<li>List item three</li>\r\n	<li>List item four</li>\r\n</ol>\r\n<h2>HTML Tags</h2>\r\nThese supported tags come from the WordPress.com code <a title="Code" href="http://en.support.wordpress.com/code/">FAQ</a>.\r\n\r\n<strong>Address Tag</strong>\r\n\r\n<address>1 Infinite Loop\r\nCupertino, CA 95014\r\nUnited States</address><strong>Anchor Tag (aka. Link)</strong>\r\n\r\nThis is an example of a <a title="Apple" href="http://apple.com">link</a>.\r\n\r\n<strong>Abbreviation Tag</strong>\r\n\r\nThe abbreviation <abbr title="Seriously">srsly</abbr> stands for "seriously".\r\n\r\n<strong>Acronym Tag (<em>deprecated in HTML5</em>)</strong>\r\n\r\nThe acronym stands for "for the win".\r\n\r\n<strong>Big Tag <strong>(<em>deprecated in HTML5</em>)</strong></strong>\r\n\r\nThese tests are a big deal, but this tag is no longer supported in HTML5.\r\n\r\n<strong>Cite Tag</strong>\r\n\r\n"Code is poetry." --<cite>Automattic</cite>\r\n\r\n<strong>Code Tag</strong>\r\n\r\nYou will learn later on in these tests that <code>word-wrap: break-word;</code> will be your best friend.\r\n\r\n<strong>Delete Tag</strong>\r\n\r\nThis tag will let you <del>strikeout text</del>, but this tag is no longer supported in HTML5 (use the <code>&lt;strike&gt;</code> instead).\r\n\r\n<strong>Emphasize Tag</strong>\r\n\r\nThe emphasize tag should <em>italicize</em> text.\r\n\r\n<strong>Insert Tag</strong>\r\n\r\nThis tag should denote <ins>inserted</ins> text.\r\n\r\n<strong>Keyboard Tag</strong>\r\n\r\nThis scarcely known tag emulates <kbd>keyboard text</kbd>, which is usually styled like the <code>&lt;code&gt;</code> tag.\r\n\r\n<strong>Preformatted Tag</strong>\r\n\r\nThis tag styles large blocks of code.\r\n<pre>.post-title {\r\n	margin: 0 0 5px;\r\n	font-weight: bold;\r\n	font-size: 38px;\r\n	line-height: 1.2;\r\n	and here''s a line of some really, really, really, really long text, just to see how the PRE tag handles it and to find out how it overflows;\r\n}</pre>\r\n<strong>Quote Tag</strong>\r\n\r\n<q>Developers, developers, developers...</q> --Steve Ballmer\r\n\r\n<strong>Strike Tag <strong>(<em>deprecated in HTML5</em>)</strong></strong>\r\n\r\nThis tag shows <span style="text-decoration: line-through;">strike-through text</span>\r\n\r\n<strong>Strong Tag</strong>\r\n\r\nThis tag shows <strong>bold<strong> text.</strong></strong>\r\n\r\n<strong>Subscript Tag</strong>\r\n\r\nGetting our science styling on with H<sub>2</sub>O, which should push the "2" down.\r\n\r\n<strong>Superscript Tag</strong>\r\n\r\nStill sticking with science and Isaac Newton''s E = MC<sup>2</sup>, which should lift the 2 up.\r\n\r\n<strong>Teletype Tag <strong>(<em>deprecated in HTML5</em>)</strong></strong>\r\n\r\nThis rarely used tag emulates teletype text, which is usually styled like the <code>&lt;code&gt;</code> tag.\r\n\r\n<strong>Variable Tag</strong>\r\n\r\nThis allows you to denote <var>variables</var>.', 'Markup HTML Tags and Formatting2', '', 'inherit', 'open', 'open', '', '1713-revision-v1', '', '', '2014-09-27 03:48:02', '2014-09-27 03:48:02', '', 1713, 'http://mytien-nacha.com/dev/1713-revision-v1/', 0, 'revision', '', 0),
(1894, 1, '2014-10-02 01:33:32', '2014-10-02 01:33:32', '<p style="color: #000000;">Theo AFP, một số người biểu tình cho biết muốn xông vào bên trong tòa nhà văn phòng của trưởng đặc khu Lương Chân Anh.</p>\r\n<p style="color: #000000;">Một chiếc xe đã suýt đâm vào đám đông khi đi qua khu vực biểu tình, càng làm gia tăng thêm căng thẳng. Người biểu tình đã hét vào cảnh sát đứng phía sau hàng rào chắn và hô khẩu hiệu đòi ông Lương phải từ chức.</p>\r\n<p style="color: #000000;">“Chúng tôi đang cố gắng bao vây toàn bộ khu nhà chính quyền và đợi ông Lương đi làm trở lại vào ngày thứ sáu (sau ngày nghỉ vào thứ năm)”, người biểu tình Thomas Choi cho biết. “Chúng tôi muốn nói chuyện mặt đối mặt với ông”.</p>\r\n<p style="color: #000000;" align="center"><img src="http://dantri4.vcmedia.vn/SF9n0XnWe1mhJ0SanI/Image/2014/10/1-69a79.jpg" alt="Người biểu tình dùng ô, biểu tượng của cuộc biểu tình, che mưa cho cảnh sát." />\r\nNgười biểu tình dùng ô, biểu tượng của cuộc biểu tình, che mưa cho cảnh sát.</p>\r\n<p style="color: #000000;">Căng thẳng tăng cao sau 3 ngày biểu tình hòa bình, với hàng chục ngàn người chiếm các tuyến đường cao tốc của Hồng Kông, kêu gọi Bắc Kinh cho phép Hồng Kông được tiến hành bầu cử tự do hơn.</p>\r\n\r\n<div id="article-side-rail" class="article-side-rail" style="color: #000000;">\r\n<div class="article-video-relation">\r\n<div class="relative"><img class="thumb" src="http://video-thumbs.vcmedia.vn//" alt="Chủ tịch Tập Cận Bình lên tiếng về Hồng Kông" /><img class="ico" src="http://dantri3.vcmedia.vn/App_Themes/Default/Images/ico_video_play.png" alt="" /></div>\r\n<p class="caption" style="font-weight: bold; color: #999999;">Chủ tịch Tập Cận Bình lên tiếng về Hồng Kông</p>\r\n\r\n</div>\r\n</div>\r\n<p style="color: #000000;" align="center"><img src="http://dantri4.vcmedia.vn/SF9n0XnWe1mhJ0SanI/Image/2014/10/2-69a79.jpg" alt="Người biểu tình dùng ô, biểu tượng của cuộc biểu tình, che mưa cho cảnh sát." /></p>\r\n<p style="color: #000000;" align="center">Người biểu tình ngồi trước văn phòng trưởng đặc khu cho tới khi ông quay trở lại làm việc vào ngày thứ sáu.</p>\r\n<p style="color: #000000;">Vào tối ngày hôm qua, một lãnh đạo biểu tình của nhóm sinh viên đã dọa sẽ tăng cường biểu tình, trong đó có khả năng chiếm các văn phòng chính quyền nếu cho đến ngày hôm nay 2/10 ông Lương không từ chức.</p>\r\n<p style="color: #000000;" align="center"><img src="http://dantri4.vcmedia.vn/SF9n0XnWe1mhJ0SanI/Image/2014/10/4-69a79.jpg" alt="Viết ủng hộ cho người biểu tình." /></p>\r\n<p style="color: #000000;" align="center">Viết ủng hộ cho người biểu tình.</p>\r\n<p style="color: #000000;">“Chúng tôi sẽ xem xét các hành động khác nhau trong những ngày tới, gồm cả chiếm cả những nơi khác như các văn phòng chính phủ quan trọng”, Anges Chow cho biết.</p>\r\n<p style="color: #000000;">Sinh viên đã là lực lượng nòng cốt trong các cuộc biểu tình ở Hồng Kông. Tuy nhiên, số những người khác tham gia biểu tình cũng tăng lên kể từ khi cảnh sát bắn đạn hơi cay vào người biểu tình vào tối ngày chủ nhật.</p>\r\n<p style="color: #000000;" align="center"><img src="http://dantri4.vcmedia.vn/SF9n0XnWe1mhJ0SanI/Image/2014/10/3-69a79.jpg" alt="Người biểu tình từ chối về nhà." /></p>\r\n<p style="color: #000000;" align="center">Người biểu tình từ chối về nhà.</p>\r\n<p style="color: #000000;">Trong động thái làm giảm căng thẳng, các công ty lữ hành ở Trung Quốc đại lục cho biết visa du lịch nhóm tới Hồng Kông đã bị ngưng cấp.</p>\r\n<p style="color: #000000;">“Tôi nghe về điều này từ nhiều công ty lữ hành ở Trung Quốc đại lục”, Joseph Tung, giám đốc điều hành Hội đồng du lịch Hồng Kông cho biết, song nhấn mạnh động thái chưa được Bắc Kinh xác nhận.</p>\r\n<p style="color: #000000;">Từ 1-7/10 được biết đến là “Tuần lễ vàng” ở Trung Quốc đại lục, là dịp lễ mua sắm quan trọng, với nhiều người đi du lịch tới Hồng Kông.</p>', '3.000 người “vây” văn phòng Trưởng Đặc Khu Hồng Kông', '', 'publish', 'open', 'open', '', '3-000-nguoi-vay-van-phong-truong-dac-khu-hong-kong', '', '', '2015-07-07 03:57:24', '2015-07-07 03:57:24', '', 0, 'http://mytien-nacha.com/dev/?post_type=tin-tuc&#038;p=1894', 0, 'tin-tuc', '', 0),
