(1898, 5, '2014-10-02 04:51:47', '2014-10-02 04:51:47', 'Đây là một trang tĩnh mẫu. Nó khác với một bài viết ở chỗ nó sẽ luôn ở một vị trí và sẽ được hiển thị tại thực đơn điều hướng trên trang mạng của bạn (với hầu hết các giao diện). Hầu hết mọi người bắt đầu với trang Giới Thiệu kể về họ với người đọc. Nó có thể được viết như sau:\n<blockquote>Xin chào! tôi là người chuyển hàng bằng xe đạp vào ban ngày, diễn viên luôn nỗ lực tiến bộ vào buổi tối, và đây là trang nhật ký trực tuyến của tôi. Tôi sống ở Los Angeles, tôi nuôi một con chó tuyệt vời tên là Jack, và tôi thích piña coladas. (Và có thể gặp trong mưa.)</blockquote>\n...hoặc tương tự như:\n<blockquote>Công ty Đồ dùng XYZ được thành lập năm 1971, và đã cung cấp đồ dùng chất lượng cho cộng đồng từ thời điểm đó. Tại thành phố Gotham, XYZ tạo ra việc làm cho hơn 2,000 người và làm ra những đồ dùng tuyệt vời phục vụ mọi nhu cầu cho người dân Gotham.</blockquote>\nLà một người sử dụng WordPress mới, bạn nên truy cập bảng thống kê để xóa trang tĩnh này và tạo trang tĩnh mới cho nội dung của bạn. Hãy tận hưởng!', 'Giới thiệu', '', 'inherit', 'open', 'open', '', '2-autosave-v1', '', '', '2014-10-02 04:51:47', '2014-10-02 04:51:47', '', 2, 'http://mytien-nacha.com/dev/2-autosave-v1/', 0, 'revision', '', 0),
