(1909, 1, '2015-07-07 03:57:24', '2015-07-07 03:57:24', '<p style="color: #000000;">Theo AFP, một số người biểu tình cho biết muốn xông vào bên trong tòa nhà văn phòng của trưởng đặc khu Lương Chân Anh.</p>\r\n<p style="color: #000000;">Một chiếc xe đã suýt đâm vào đám đông khi đi qua khu vực biểu tình, càng làm gia tăng thêm căng thẳng. Người biểu tình đã hét vào cảnh sát đứng phía sau hàng rào chắn và hô khẩu hiệu đòi ông Lương phải từ chức.</p>\r\n<p style="color: #000000;">“Chúng tôi đang cố gắng bao vây toàn bộ khu nhà chính quyền và đợi ông Lương đi làm trở lại vào ngày thứ sáu (sau ngày nghỉ vào thứ năm)”, người biểu tình Thomas Choi cho biết. “Chúng tôi muốn nói chuyện mặt đối mặt với ông”.</p>\r\n<p style="color: #000000;" align="center"><img src="http://dantri4.vcmedia.vn/SF9n0XnWe1mhJ0SanI/Image/2014/10/1-69a79.jpg" alt="Người biểu tình dùng ô, biểu tượng của cuộc biểu tình, che mưa cho cảnh sát." />\r\nNgười biểu tình dùng ô, biểu tượng của cuộc biểu tình, che mưa cho cảnh sát.</p>\r\n<p style="color: #000000;">Căng thẳng tăng cao sau 3 ngày biểu tình hòa bình, với hàng chục ngàn người chiếm các tuyến đường cao tốc của Hồng Kông, kêu gọi Bắc Kinh cho phép Hồng Kông được tiến hành bầu cử tự do hơn.</p>\r\n\r\n<div id="article-side-rail" class="article-side-rail" style="color: #000000;">\r\n<div class="article-video-relation">\r\n<div class="relative"><img class="thumb" src="http://video-thumbs.vcmedia.vn//" alt="Chủ tịch Tập Cận Bình lên tiếng về Hồng Kông" /><img class="ico" src="http://dantri3.vcmedia.vn/App_Themes/Default/Images/ico_video_play.png" alt="" /></div>\r\n<p class="caption" style="font-weight: bold; color: #999999;">Chủ tịch Tập Cận Bình lên tiếng về Hồng Kông</p>\r\n\r\n</div>\r\n</div>\r\n<p style="color: #000000;" align="center"><img src="http://dantri4.vcmedia.vn/SF9n0XnWe1mhJ0SanI/Image/2014/10/2-69a79.jpg" alt="Người biểu tình dùng ô, biểu tượng của cuộc biểu tình, che mưa cho cảnh sát." /></p>\r\n<p style="color: #000000;" align="center">Người biểu tình ngồi trước văn phòng trưởng đặc khu cho tới khi ông quay trở lại làm việc vào ngày thứ sáu.</p>\r\n<p style="color: #000000;">Vào tối ngày hôm qua, một lãnh đạo biểu tình của nhóm sinh viên đã dọa sẽ tăng cường biểu tình, trong đó có khả năng chiếm các văn phòng chính quyền nếu cho đến ngày hôm nay 2/10 ông Lương không từ chức.</p>\r\n<p style="color: #000000;" align="center"><img src="http://dantri4.vcmedia.vn/SF9n0XnWe1mhJ0SanI/Image/2014/10/4-69a79.jpg" alt="Viết ủng hộ cho người biểu tình." /></p>\r\n<p style="color: #000000;" align="center">Viết ủng hộ cho người biểu tình.</p>\r\n<p style="color: #000000;">“Chúng tôi sẽ xem xét các hành động khác nhau trong những ngày tới, gồm cả chiếm cả những nơi khác như các văn phòng chính phủ quan trọng”, Anges Chow cho biết.</p>\r\n<p style="color: #000000;">Sinh viên đã là lực lượng nòng cốt trong các cuộc biểu tình ở Hồng Kông. Tuy nhiên, số những người khác tham gia biểu tình cũng tăng lên kể từ khi cảnh sát bắn đạn hơi cay vào người biểu tình vào tối ngày chủ nhật.</p>\r\n<p style="color: #000000;" align="center"><img src="http://dantri4.vcmedia.vn/SF9n0XnWe1mhJ0SanI/Image/2014/10/3-69a79.jpg" alt="Người biểu tình từ chối về nhà." /></p>\r\n<p style="color: #000000;" align="center">Người biểu tình từ chối về nhà.</p>\r\n<p style="color: #000000;">Trong động thái làm giảm căng thẳng, các công ty lữ hành ở Trung Quốc đại lục cho biết visa du lịch nhóm tới Hồng Kông đã bị ngưng cấp.</p>\r\n<p style="color: #000000;">“Tôi nghe về điều này từ nhiều công ty lữ hành ở Trung Quốc đại lục”, Joseph Tung, giám đốc điều hành Hội đồng du lịch Hồng Kông cho biết, song nhấn mạnh động thái chưa được Bắc Kinh xác nhận.</p>\r\n<p style="color: #000000;">Từ 1-7/10 được biết đến là “Tuần lễ vàng” ở Trung Quốc đại lục, là dịp lễ mua sắm quan trọng, với nhiều người đi du lịch tới Hồng Kông.</p>', '3.000 người “vây” văn phòng Trưởng Đặc Khu Hồng Kông', '', 'inherit', 'open', 'open', '', '1894-revision-v1', '', '', '2015-07-07 03:57:24', '2015-07-07 03:57:24', '', 1894, 'http://localhost/news/1894-revision-v1/', 0, 'revision', '', 0),
