(2204, 7, '2016-04-08 16:11:16', '2016-04-08 16:11:16', 'CÔNG TY TNHH Quảng cáo và công nghệ Đức Phát được thành lập bởi các chuyên viên thiết kế và sản xuất với thâm niên lâu năm trong việc thiết kế và thi công hoàn thiện biển hiệu trên các chất liệu. Chúng tôi luôn mong muốn gia tăng thương hiệu của khách hàng thông qua các hệ thống bảng hiệu, bởi thương hiệu là tài sản vô hình nhưng đóng góp một phần không hề nhỏ trong việc phát triển thương hiệu và tiếp cận khách hàng. Một số lĩnh vực thế mạnh của Đức Phát:\r\n\r\n1. Làm biển quảng cáo:\r\n- Làm biển quảng cáo bạt hiflex\r\n- Làm biển quảng cáo Alu (aluminium - alcorest)\r\n- Làm biển quảng cáo hộp đèn\r\n- Làm biển quảng cáo chữ nổi mica, đồng, Inox...\r\n- Tranh tường khổ lớn, Tranh kính, Tranh điện theo yêu cầu.\r\n- Treo phướn trên địa bàn Hà Nội\r\n- Làm biển quảng cáo led sign\r\n\r\n2. Thiết kế\r\n- Thiết kế gian hàng triễn lãm, trung tâm thương mại và showroom\r\n- Thiết kế đồ họa (nhận diện thương hiệu, đồ họa quảng cáo truyền thông, Các ấn phẩm phục vụ sự kiện, Quảng cáo truyền thông: Banner, Poster, standee…...)\r\n- Đồ họa động trong truyền hình (Clip quảng cáo sản phẩm, giới thiệu về công ty, biên tập nội dung clip sự kiện)\r\n\r\n3. Các hoạt động về in ấn\r\n- In HIFI khổ lớn trên các chất liệu: giấy ảnh, giấy PP, PP decan, Decan trong, Decan lưới, Backlit, Lụa ….. (có cán keo 2 mặt).\r\n- In Offset: Namecard, tờ thư, phong bì, kẹp file, tài liệu quảng cáo, tờ rơi, catalog, sách, tạp chí …\r\n- In Name card siêu tốc, Thẻ VIP, Voucher, thẻ nhựa (dập chữ nổi), tờ rơi, thư mời…\r\n\r\nHãy liên hệ ngay với chúng tôi để được tư vấn và phục vụ tận nơi. Đức Phát cam kết về chất lượng sản phẩm với một mức giá cạnh tranh, chắc chắn sẽ đem lại hiệu quả tối đa cho lĩnh vực quảng cáo sản phẩm và dịch vụ của khách hàng.\r\n\r\nRất mong nhận được sự quan tâm và hợp tác của quý vị!\r\n\r\nTrân trọng!', 'Giới thiệu', '', 'inherit', 'open', 'open', '', '2-revision-v1', '', '', '2016-04-08 16:11:16', '2016-04-08 16:11:16', '', 2, 'http://quangcaoducphat.com/2-revision-v1/', 0, 'revision', '', 0),
(1979, 1, '2015-08-20 09:59:20', '2015-08-20 09:59:20', '<h2>Quảng Cáo Thăng Long nhận thi công biển quảng cáo shop thời trang – mỹ phẩm cao cấp với nhiều mẫu thiết kế đa dạng phù hợp với nhu cầu kinh doanh theo đúng ngành hàng của quý khách.<span id="more-1427"></span></h2>\r\nTại <a href="http://quangcaothanglong.vn/" target="_blank">Quảng Cáo Thăng Long</a> chúng tôi có nhiều mẫu chủng loại vật liệu để quý khách hàng có thể thoải mái lựa chọn. Bên cạnh đó chúng tôi còn cung cấp các loại tủ, quầy kệ, đèn trang trí tủ hàng cho quý khách, chúng tôi sản xuất các loại tranh mica siêu mỏng, hộp đèn siêu mỏng để cài poster trưng bày sản phẩm tạo nên sự sang trọng hấp dẫn.\r\n\r\nKhách hàng có nhu cầu với những đơn hàng lớn chúng tôi còn chiết khấu sâu và nhiều hấp dẫn (ngoài ra chúng tôi còn nhận tư vấn thiết kế các gian hàng, showroom theo ý tưởng và yêu cầu của khách hàng)\r\n\r\n<a href="http://quangcaothanglong.vn/wp-content/uploads/2014/01/bien-shop-my-pham-1.jpg" data-slb-active="1" data-slb-asset="194865353" data-slb-internal="0" data-slb-group="1427"><img class="alignnone wp-image-1428 size-full" src="http://quangcaothanglong.vn/wp-content/uploads/2014/01/bien-shop-my-pham-1.jpg" alt="biển quảng cáo shop thời trang - mỹ phẩm 1" width="700" height="408" /></a><a href="http://quangcaothanglong.vn/wp-content/uploads/2014/01/bien-shop-my-pham-2.jpg" data-slb-active="1" data-slb-asset="813421648" data-slb-internal="0" data-slb-group="1427"><img class="alignnone wp-image-1429 size-full" src="http://quangcaothanglong.vn/wp-content/uploads/2014/01/bien-shop-my-pham-2.jpg" alt="biển quảng cáo shop thời trang - mỹ phẩm 2" width="700" height="525" /></a><a href="http://quangcaothanglong.vn/wp-content/uploads/2014/01/bien-shop-my-pham-3.jpg" data-slb-active="1" data-slb-asset="31548276" data-slb-internal="0" data-slb-group="1427"><img class="alignnone wp-image-1430 size-full" src="http://quangcaothanglong.vn/wp-content/uploads/2014/01/bien-shop-my-pham-3.jpg" alt="biển quản